class NewsResponse {
  NewsResponse({
      String? status, 
      num? totalResults, 
      List<News>? articles,}){
    _status = status;
    _totalResults = totalResults;
    _articles = articles;
}

  NewsResponse.fromJson(dynamic json) {
    _status = json['status'];
    _totalResults = json['totalResults'];
    if (json['articles'] != null) {
      _articles = [];
      json['articles'].forEach((v) {
        _articles?.add(News.fromJson(v));
      });
    }
  }
